import { useState,useEffect } from "react"
import { Container, Row } from "react-bootstrap";
import { useLocation } from "react-router";
import Apis, { endpoints } from '../Configs/Apis';
import MyCard from "../Layouts/Mycard";




export default function Home(){
    let [courses , setCourses] = useState([])
    let location = useLocation()
    
    // eslint-disable-next-line react-hooks/exhaustive-deps
    useEffect( async() => {
        let query = location.search
        let res = await Apis.get(`${endpoints['courses']}${query}`).then(resp=>{
            setCourses(resp.data.results)
        })
        // let res = await Apis.get(endpoints['courses']).then(datas=>{
        //     setCourses(datas.data.results)
        // })
    })

    return(

<Container>
    <Row>
        {courses.map( (u,index)=> <MyCard key={index} obj = {u}/>)}
    </Row>
</Container>

    )
}
